require.config({
	paths:{
		"jquery":["http://code.jquery.com/jquery-2.1.1.min.js"]
	}
})
require(['jquery','test'],function($){
	var map=[];
	for(var i=0;i<geoCoordMap.length;i++){
		map.push({
			comId:geoCoordMap[i].comId
		});
	}
	function query(x){
		$.ajax({
			type:"GET",
			url:"http://localhost:8080/BIMPlus/capacity.json",
			data:map[x],
			dataType:"jsonp",
			jsonp:"callback",
			jsonpCallback:"callbackFun",
			success: function(json){
				for(var i=0;i<json.length;i++){
					$("#test").append(json[i].capacity+"<br/>");
				}
				//$("#test").append($("#form1").serialize());
			},
			error:function(){
				alert("something wrong!");
			}	
		});
	}
})

	